import React from "react";
import "../css/siparis.css";
import { NavLink } from "react-router-dom";

const SiparisVer = () => {
  return (
    <div>
      <div className="Siparis-page">
        <div className="container">
          <div className="img-div"></div>
          <NavLink to="/" exact>
            Anasayfa
          </NavLink>
        </div>
      </div>
    </div>
  );
};
export default SiparisVer;
